ar  sukses dan  disiplin pola makan agar sehat terus yaa..','2024-12-15 05:59:23','2024-12-16 07:52:07'),(523,'202481112-12BD2','2024-2025','Ganjil','5','1202215670','Berani bermimpi besar, karena impianmu adalah bahan bakar untuk meraih kesuksesan. Selalu berkreasi dan terus berkarya, Ghita.. Inshaa Allah, sukses buat Ghita... Semangat!','2024-12-15 05:59:23','2024-12-16 07:53:50'),(524,'202481112-12BD2','2024-2025','Ganjil','5','1202215684','Terlibatlah dalam proses belajar, karena itulah yang membentuk karakter dan kepribadian yang kuat.','2024-12-15 05:59:23','2024-12-16 08:18:58'),(525,'202481112-12BD2','2024-2025','Ganjil','5','1202215702','Jadilah seseorang yang gigih dalam belajar, karena itu adalah kunci rahasia kesuksesan.','2024-12-15 05:59:23','2024-12-16 08:18:55'),(526,'202481112-12BD2','2024-2025','Ganjil','5','1202215723','Sesulit apapun pelajaran, jangan pernah meragukan potensimu sendiri!','2024-12-15 05:59:23','2024-12-16 08:19:04'),(527,'202481112-12BD2','2024-2025','Ganjil','5','1202215769','Tidak ada yang mustahil untuk dipelajari, yang membuatnya sulit hanyalah ketidakberanian untuk mencoba. Jadi pribadi yang lebih berani lagi, Merlin punya potensi. Semangat!','2024-12-15 05:59:23','2024-12-16 08:20:48'),(528,'202481112-12BD2','2024-2025','Ganjil','5','1202215809','Jangan membuang waktu belajarmu ya, Nad, karena apa yang kamu pelajari akan berguna untuk masa depanmu.','2024-12-15 05:59:23','2024-12-16 08:07:11'),(529,'202481112-12BD2','2024-2025','Ganjil','5','1202215863','Novi adalah ciptaan Allah SWT yang istimewa, manfaatkan dan tingkatkan terus potensinya. Semangat, Novi!','2024-12-15 05:59:23','2024-12-19 20:58:13'),(530,'202481112-12BD2','2024-2025','Ganjil','5','1202215897','Raisha punya potensi, tingkatkan terus potensi yang ada di diri Raisha. Usaha tidak akan membohongi hasil, percaya itu ya...','2024-12-15 05:59:23','2024-12-16 08:49:11'),(531,'202481112-12BD2','2024-2025','Ganjil','5','1202215919','Belajarlah dengan penuh keyakinan dan semangat, karena itu adalah kunci utama untuk meraih keberhasilan.','2024-12-15 05:59:23','2024-12-16 08:30:44'),(532,'202481112-12BD2','2024-2025','Ganjil','5','1202215934','Semangat belajar adalah kunci untuk membuka pintu kesuksesan. Lebih semangat lagi belajarnya ya..','2024-12-15 05:59:23','2024-12-16 08:22:20'),(533,'202481112-12BD2','2024-2025','Ganjil','5','1202215950','Berpikirlah besar, belajarlah dengan giat, dan bertindaklah mantap. Maka, kesuksesan akan menjadi milikmu. Ocha sudah punya itu, konsisten dan terus semangat.','2024-12-15 05:59:23','2024-12-16 08:23:52'),(534,'202481112-12BD2','2024-2025','Ganjil','5','1202215996','Jangan biarkan pemikiran negatif menghalangi langkahmu dalam belajar, selalu percaya bahwa Alin mampu mencapai impian Alin.','2024-12-15 05:59:23','2024-12-16 08:55:26'),(535,'202481112-12BD2','2024-2025','Ganjil','5','1202216014','Perjuangkan impianmu dengan tekad yang kuat dan keyakinan yang teguh. Semangat belajar Surya akan menjadi cahaya yang membimbing langkahmu menuju impian Surya!','2024-12-15 05:59:23','2024-12-16 08:53:23'),(536,'202481112-12BD2','2024-2025','Ganjil','5','1202216020','Tanti, hidupmu akan lebih berwarna dan bermakna jika setiap hari diisi dengan semangat belajar dan pengetahuan baru. Semangat!','2024-12-15 05:59:23','2024-12-16 08:27:03'),(537,'202481112-12BD2','2024-2025','Ganjil','5','1202216049','Kegigihan dalam belajar akan membawamu pada jalan kesuksesan, jadi janganlah pernah menyerah, Tiwi!','2024-12-15 05:59:23','2024-12-16 08:25:58'),(538,'202481112-12BD2','2024-2025','Ganjil','5','1202216051','Jadilah seseorang yang gigih dalam belajar, karena itu adalah kunci rahasia kesuksesan.','2024-12-15 05:59:23','2024-12-16 08:21:40'),(539,'202481112-12BD2','2024-2025','Ganjil','5','1202216055','Barang siapa menginginkan dunia, hendaklah ia berilmu. Barang siapa menginginkan akhirat, hendaklah ia berilmu. Pertahankan kepribadian baik Wira dan terus semangat! Proud of You!','2024-12-15 05:59:23','2024-12-16 08:06:07'),(540,'202481112-12BD2','2024-2025','Ganjil','5','1202216070','Jadilah seperti pohon yang kokoh, tetap tegar meski diterpa badai. Tantangan yang Shelman hadapi sekarang akan membentukmu menjadi pribadi yang lebih kuat di masa depan. Lebih semangat lagi belajar nya ya.. Caio!','2024-12-15 05:59:23','2024-12-16 08:59:00'),(541,'202481112-12BD2','2024-2025','Ganjil','5','1202216089','Intan adalah ciptaan Allah SWT yang istimewa, manfaatkan dan tingkatkan terus potensinya. Semangat, Intan!','2024-12-15 05:59:23','2024-12-16 07:57:10'),(542,'202483312-12AK1','2024-2025','Ganjil','5','1202215472','Selamat atas prestasi yang telah diraih! Pertahankan kedisiplinan dan terus semangat belajar untuk meraih hasil yang lebih baik lagi.\"','2024-12-15 18:00:46','2024-12-17 07:18:38'),(543,'202483312-12AK1','2024-2025','Ganjil','5','1202215481','\"Semester ini penuh tantangan. Tetap semangat dan jangan ragu meminta bantuan jika mengalami kesulitan dalam belajar.\"','2024-12-15 18:00:46','2024-12-17 07:21:35'),(544,'202483312-12AK1','2024-2025','Ganjil','5','1202215507','\"Kamu memiliki banyak potensi. Dengan usaha yang lebih giat, kamu bisa meraih hasil yang lebih memuaskan.\"','2024-12-15 18:00:46','2024-12-17 07:24:44'),(545,'202483312-12AK1','2024-2025','Ganjil','5','1202215518','Perhatikan waktu dan tugas-tugas sekolah agar lebih terorganisir. Kami yakin kamu bisa menjadi lebih disiplin.\"','2024-12-15 18:00:46','2024-12-17 07:23:07'),(546,'202483312-12AK1','2024-2025','Ganjil','5','1202215538','Perhatikan waktu dan tugas-tugas sekolah agar lebih terorganisir. Kami yakin kamu bisa menjadi lebih disiplin.\"','2024-12-15 18:00:46','2024-12-17 07:23:26'),(547,'202483312-12AK1','2024-2025','Ganjil','5','1202215574','\"Semester ini menunjukkan bahwa kamu punya potensi besar. Fokuslah pada pengelolaan waktu belajar agar hasil lebih optimal.\"','2024-12-15 18:00:46','2024-12-17 07:47:27'),(548,'202483312-12AK1','2024-2025','Ganjil','5','1202215600','Perhatikan waktu 